import "./style.css";
import flower from "../images/flower.png";
const MainPage = () => {
  const noList = [
    { 1: "No" },
    { 2: "Must be a misclick, try again" },
    { 3: "Ouch " },
    { 4: "How could you ðŸ¥¹? Please think again" },
  ];
  const handleNo = () => {};
  return (
    <div id="main">
      <div id="container">
        <img
          src={flower}
          width={"200px"}
          height={"200px"}
          style={{ margin: "20px" }}
        />
        <h2>Will you be my valentine bb?</h2>
        <div id="button-container">
          <button type="button" id="yes-btn" className="buttons">
            Yes
          </button>
          <button
            type="button"
            id="no-btn"
            className="buttons"
            onClick={handleNo}
          >
            No
          </button>
        </div>
      </div>
    </div>
  );
};
export default MainPage;
